                Name: "Kekuli Bay Trail",
                Description:
                    "Kekuli Bay Provincial Park is situated on a scenic bay on the west side of Kalamalka Lake. Park amenities include a campground, playground, picnic tables, toilets, public beach, and boat launch. The park Loop Trail encircles the campground, passing through native grasslands and offers several benches to rest and absorb the amazing vistas.",
                Access: "Located off Highway 97, 11 km south of Vernon. Directions. Parking is limited during the summer months.\r\n- East Bailey Road, parking lot above the park, on Highway 97 turn east onto Bailey Road (opposite Predator Ridge turnoff). \r\nThe Okanagan Rail Trail bisects the park near the water, providing easy walking or cycling opportunities north and south along Kalamalka Lake.\r\nThe Kal Crystal Waters Trail bisects the park along the top of the park, adjacent to Highway 97.",
