                Description:
                    "The BX Ranch Trail is a lovely 2.25 km trail that wraps around the former BX Ranch farmlands, passing Mutrie Dog Park and ending at BX Ranch Dog Park.",
                Access: "Trail has three entrance points and does not loop:\r\n- East Vernon Road (east trailhead): From Black Rock Road, turn north onto East Vernon Road. A small parking lot and trailhead signpost are on west side of road, near big wooden barn. \r\n- BX Ranch Dog Park (north trailhead): From the parking lot, head south, across BX Road, up the hill through an idyllic shaded pine forest. At the top of the hill, the trail enters the flat ranchlands and continues south towards Mutrie Dog Park. \r\n- Mutrie Dog Park (central trailhead): On Mutrie Road at the east end of the park, a gate enters the middle of the trail. Head north 0.85 km to the BX Ranch Dog Park on BX Road. Or head 1.4 km south and east to the East Vernon Rd Trailhead and parking lot. ",
