                OBJECTID: 348,
                Name: "Grey Canal Trail- Blue Jay Road to Turtle Mountain",
                Description:
                    "The trail starts with easy flat terrain but dips steeply down to a boardwalk which hugs an ancient lava flow wall created many million years ago. The trail continues with a steep climb uphill and then is level for 3.5 km to Blue Jay Road.  A portion of the former Grey Canal’s Knight Siphon, a steel pipe 630 metres long and 50 cm in diameter, can still be seen. \r\n\r\nFeatures: Great views of Swan Lake, Silver Star Mountain, Middleton Mountain and the city. The beginning of the trail contains some steep sections with loose rock but continues into a wide level dirt-packed surface. Benches to enjoy the vistas. Interpretive signs. Easy to moderate. Dogs on leash are allowed.",
